const BASE_URL = process.env.VUE_APP_BACKEND_URL;

const state = {
  clients: [],
  client: {
    id: 0,
    code: "",
    full_name: "",
    identification_card: "",
    rfc: "",
    address: "",
    colony: "",
    zip_code: "",
    phone_number: "",
    city: "",
    state: "",
    country: "",
    assignee: "",
    email: "",
    birthday: "0000-00-00",
    nationality: "",
    civil_status: "",
    spouse: "",
    economic_dependants: false,
    home_owner: false,
    occupation: "",
    company: "",
    company_address: "",
    company_phone: "",
    monthly_income: 0.0,
    monthly_expenses: 0.0,
